/* ----------------------------
	MaxMind + Cookie
---------------------------- */

function bolt_maxmind_cookie() {
	function bolt_customer_support($bolt_number) {
		$('.link--phone-number .text').text($bolt_number);
		$('.link--phone-number').attr("href", "tel:"+$bolt_number);
		$('.module__live-chat').remove();
	}
	var $bolt_returning_visitor = Cookies.get('bolt');
	if ($bolt_returning_visitor) {
		$bolt_returning_visitor_country_code = Cookies.get('bolt');
		if ($bolt_returning_visitor_country_code == "US" || $bolt_returning_visitor_country_code == "CA") {
			// USA + Canada
			$('.module__live-chat').fadeIn();
		} else if ($bolt_returning_visitor_country_code == "MX") {
			// Mexico
			bolt_customer_support("001-8772269212");
		} else if ($bolt_returning_visitor_country_code == "ID") { 
			// Indonesia
			bolt_customer_support("007-803-011-4752");
		} else {
			// International
			bolt_customer_support("00800-33753375");
		}
	} else {
		if(navigator.userAgent.match(/bot|googlebot|crawler|spider|robot|crawling|wget|cURL/i)) {
		} else {
			$.getScript("//js.maxmind.com/js/apis/geoip2/v2.1/geoip2.js", function(){
				var onSuccess = function(location) {
					$user_country_code = location.country.iso_code;
					if ($user_country_code == "CA" || $user_country_code == "US") {
						// USA + Canada
						$('.module__live-chat').fadeIn();
					} else if ($user_country_code == "MX") {
						// Mexico
						bolt_customer_support("001-8772269212");
					} else if ($user_country_code == "ID") {
						// Indonesia
						bolt_customer_support("007-803-011-4752");
					} else {
						// International
						bolt_customer_support("00800-33753375");
					}
					Cookies.set(
						'bolt',
						$user_country_code,
						{
							expires: 30
						}
					);
				};
				var onError = function(error){};
				geoip2.insights(onSuccess, onError);
			});
		};
	}
}

