/* ----------------------------
	Sort customers
---------------------------- */

function sort_customers() {

	function getHashFilter() {
		var hash = location.hash;
		var matches = location.hash.match( /filter=([^&]+)/i );
		var hashFilter = matches && matches[1];
		return hashFilter && decodeURIComponent( hashFilter );
	}

	var $container = $('#customer-listing ul');
	var $filters = $('#filters').on( 'click', 'button', function() {
		var filterAttr = $( this ).attr('data-filter');
		location.hash = 'filter=' + encodeURIComponent( filterAttr );
	});

	var isIsotopeInit = false;
	function onHashchange() {
		var hashFilter = getHashFilter();
		if ( !hashFilter && isIsotopeInit ) {
			return;
		}
		isIsotopeInit = true;
		$container.isotope({
			itemSelector: 'li',
			filter: hashFilter
		});
		if ( hashFilter ) {
			$filters.find('.is-checked').removeClass('is-checked');
			$filters.find('[data-filter="' + hashFilter + '"]').addClass('is-checked');
		}

	}

	$(window).on( 'hashchange', onHashchange );
	onHashchange();

	// Drawer

	$drawer = $('#customer-sort-categories');
	$drawer_opener = $('#customer-sort-intro p');

	$drawer_opener.on( 'click', 'button', function() {
		$drawer.toggle();
	});

	$('#customer-sort-categories').on('click', 'button', function() {
		$sort_text = $(this).data("sort-text");
		$sort_button = $('#customer-sort-intro p button').html($sort_text);
		$drawer.fadeOut('fast');
	});

}



/* ----------------------------
	Help modal
---------------------------- */

function help_modal() {

	var anchor = location.href.split('#')[1];

	if(anchor !== undefined && anchor.split('hc=')[1] !== undefined) {
		var hc = anchor.split('hc=')[1];
		$('#modal-helpcenter').modal({keyboard: true});
		$('#modal-helpcenter .company_name').html(hc);
		$('#modal-helpcenter .btn-primary').unbind().click(function() {
		window.history.go(-1);
			return false;
		});
	}

}



