/* ----------------------------
	Form validation
---------------------------- */

function validation() {

	$.validator.setDefaults({
		highlight: function(element) {
			$(element).closest('.form-group').addClass('has-error');
		},
		unhighlight: function(element) {
			$(element).closest('.form-group').removeClass('has-error');
		},
		errorElement: 'span',
		errorClass: 'help',
		errorPlacement: function(error, element) {
			if(element.parent('.input-group').length) {
				error.insertAfter(element.parent());
			} else {
				error.insertAfter(element);
			}
		}
	});

	$().ready(function() {
		$("#form-newsletter").validate({
			rules: {
				email: {
					required: true,
					email: true
				}
			},
			messages: {
				email: ""
			}
		});
	});

	$().ready(function() {
		$("#form-meet-desk").validate({
			rules: {
				firstname: {
					required: true
				},
				lastname: {
					required: true
				},
				email: {
					required: true,
					email: true
				},
				zipcode: {
					required: true
				},
				company: {
					required: true
				}
			},
			messages: {
				email: "",
				firstname: "",
				lastname: "",
				zipcode: "",
				company: ""
			}
		});
	});

	$().ready(function() {
		$("#df-newsletter-form").validate({
			rules: {
				email: {
					required: true,
					email: true
				}
			},
			messages: {
				email: ""
			}
		});
	});

}

/* ----------------------------
	Media queries
---------------------------- */

function media() {

	// Compile handlebar template
	
	function sb_tpl(template,location) {
		var source = $(template).html();
		var templatey = Handlebars.compile(source);
		$(location).html(templatey());
	}

	/* ==========================
		Mobile
	========================== */

	var $navbar = $('.navbar-collapse');
	var $sidr = $('.sidr');

	enquire.register("screen and (max-width: 992px)", {
		match:function() {
			$('body').addClass('is-mobile').removeClass('is-desktop');
			sb_tpl('#tpl_primary_nav_mobile','#primary-nav');
			$.sidr('close', 'sidr');
			off_canvas_sidebar();
		},
		unmatch:function() {
			//$('.sidr').hide();
			//$.sidr('close', 'sidr');
		}
	}, true);
 
	/* ==========================
		Tablets & Desktops
	========================== */

	enquire.register("screen and (min-width: 992px)", {
		match:function() {
			$('body').addClass('is-desktop').removeClass('is-mobile');
			$navbar.appendTo('#primary-nav');
			$.sidr('close', 'sidr');
		},
		unmatch:function() {
			//$.sidr('close', 'sidr');
		}
	}, true);

}



